import React from 'react';
import {Button} from 'antd'
import { Table, Space } from 'antd';
import {Container} from './style';

export default function Painel({btns, children}){
    const columns = [
        {
          title: 'Aluno',
          dataIndex: 'aluno',
          key: 'aluno',
          render: aluno => <a>{aluno}</a>,
        },
        {
          title: 'E-mail',
          dataIndex: 'E-mail',
          key: 'E-mail',
        },
        {
          title: 'RA',
          dataIndex: 'ra',
          key: 'ra',
        },
        {
          title: 'Action',
          key: 'action',
          render: (text, record) => (
            <Space size="middle">
              <a>Ler</a>
              <a>Parecer</a>
            </Space>
          ),
        },
      ];
    return(
        <Container>
            <Table colums={columns}>

            </Table>
        </Container>
    );
}
